### The Edgar Anderson&#39;s Iris Data

--

This famous *(Fisher&#39;s or Anderson&#39;s)* iris data set gives the measurements in centimeters of the variables sepal length and width and petal length and width, respectively, for 50 flowers from each of 3 species of iris. The species are Iris setosa, versicolor, and virginica.

--

&lt;img src=&quot;data:image/png;base64,#../charts/iris.png&quot; width=&quot;80%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


---

### The Edgar Anderson&#39;s Iris Data


&lt;img src=&quot;data:image/png;base64,#../charts/iris.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

--

**Petal:** One of the colored leaf-shaped parts of a flower.

**Sepal:** One of the small leaves that contains a young flower before the flower opens, and which stays directly under the flower.

---

*Exercise:* Using the **iris** data frame, choose one pair of variables. Make one scatterplot, calculate the correlation coefficient; then write one paragraph explaining the relationship, using your calculated correlation coefficient, and saying why you believe the relationship is a causal one (one variable explains the data in the second variable) or why you think the &#39;relationship&#39; is not causal--that is, that there is another reason for the apparent relationship. If there is NO obvious relationship, explain why that is true.

--

- For this exercise, I will compare the variable *Sepal.Length* and *Petal.length*

--


``` r
# Make the scatterplot
plot(Petal.Length ~ Sepal.Length, data = iris)
```

--


``` r
# Compute the correlation coefficient
cor(iris$Sepal.Length, iris$Petal.Length)
```

```
[1] 0.8717538
```

---


&lt;img src=&quot;data:image/png;base64,#lecture-11_files/figure-html/unnamed-chunk-5-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


--

- **Note:** Must add axes labels and plot title. Be original *(optional)* by changing symbols and color.

---

&lt;img src=&quot;data:image/png;base64,#lecture-11_files/figure-html/unnamed-chunk-6-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


--

Iris flowers with large sepals tend to have large petals. *(Were you expecting this trend? Are there any consequences?, How this information can be useful? etc.)*

---

*Exercise:* Using the **iris** data frame, choose a second pair of variables. Make one graph showing side-by-side boxplots; then write one paragraph describing their relationship using the appropriate measures of center and spread and position, along with any skewing or outliers.

--

- For this exercise, I will compare the variables *Sepal.Length* and *Species*

--


``` r
# Creates the side-by-side boxplot
boxplot(Sepal.Length ~ Species, data = iris)
```

--


``` r
# Compute summary statistics by species type
tapply(iris$Sepal.Length, iris$Species, summary)
```

```
$setosa
   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. 
  4.300   4.800   5.000   5.006   5.200   5.800 

$versicolor
   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. 
  4.900   5.600   5.900   5.936   6.300   7.000 

$virginica
   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. 
  4.900   6.225   6.500   6.588   6.900   7.900 
```

Iris species differ in sepal length. Commonly, Setosas are the smallest and Virginica the largest. *(Were you expecting this trend? Are there any consequences?, How this information can be useful?, Are their differences significant? etc.)*


---

*Exercise:* Using the **iris** data frame, choose a third pair of variables and create one graph showing back-to-back stemplots; then write one paragraph describing their relationship using the appropriate measures of center and spread and position, along with any skewing or outliers.

--

- For this exercise, I will compare the variable *Petal.Length* and *Species*

--

Step 1: Split **Petal.Length** by **Species** types.

--


``` r
petal_type &lt;- split( iris$Petal.Length, iris$Species )
```


--

Step 2: Identify the name for each specie of iris flower


``` r
names(petal_type)
```

```
[1] &quot;setosa&quot;     &quot;versicolor&quot; &quot;virginica&quot; 
```


---


Step 3: Plot the back-to-back stem plot. (Note: Run **install.packages(&quot;aplpack&quot;)** before the next two lines of codes)

--


``` r
install.packages(&quot;aplpack&quot;)
```


--



``` r
library(aplpack)
stem.leaf.backback(petal_type[[2]], petal_type[[3]], m=1, show.no.depths = T)
```


--


```
___________________________________________________________________________________
  1 | 2: represents 1.2, leaf unit: 0.1 
                        petal_type[[2]]     petal_type[[3]]                    
___________________________________________________________________________________

  9988777776665555555444433222211100000| 4 |588999                                 
                                     10| 5 |000111111122334455566666677788899      
                                       | 6 |00111346779                            
                                       | 7 |                                       
___________________________________________________________________________________
n:                                   50     50                                 
___________________________________________________________________________________
```

---


- Note: The numbers 2 and 3 in double brackets represent the versicolor and virginica species respectively.

<script>var slideshow = remark.create({
"countIncrementalSlides": false
});
if (window.HTMLWidgets) slideshow.on('afterShowSlide', function (slide) {
  window.dispatchEvent(new Event('resize'));
});
(function(d) {
  var s = d.createElement("style"), r = d.querySelector(".remark-slide-scaler");
  if (!r) return;
  s.type = "text/css"; s.innerHTML = "@page {size: " + r.style.width + " " + r.style.height +"; }";
  d.head.appendChild(s);
})(document);

(function(d) {
  var el = d.getElementsByClassName("remark-slides-area");
  if (!el) return;
  var slide, slides = slideshow.getSlides(), els = el[0].children;
  for (var i = 1; i < slides.length; i++) {
    slide = slides[i];
    if (slide.properties.continued === "true" || slide.properties.count === "false") {
      els[i - 1].className += ' has-continuation';
    }
  }
  var s = d.createElement("style");
  s.type = "text/css"; s.innerHTML = "@media print { .has-continuation { display: none; } }";
  d.head.appendChild(s);
})(document);
// delete the temporary CSS (for displaying all slides initially) when the user
// starts to view slides
(function() {
  var deleted = false;
  slideshow.on('beforeShowSlide', function(slide) {
    if (deleted) return;
    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {
      node = sheets[i].ownerNode;
      if (node.dataset["target"] !== "print-only") continue;
      node.parentNode.removeChild(node);
    }
    deleted = true;
  });
})();
// add `data-at-shortcutkeys` attribute to <body> to resolve conflicts with JAWS
// screen reader (see PR #262)
(function(d) {
  let res = {};
  d.querySelectorAll('.remark-help-content table tr').forEach(tr => {
    const t = tr.querySelector('td:nth-child(2)').innerText;
    tr.querySelectorAll('td:first-child .key').forEach(key => {
      const k = key.innerText;
      if (/^[a-z]$/.test(k)) res[k] = t;  // must be a single letter (key)
    });
  });
  d.body.setAttribute('data-at-shortcutkeys', JSON.stringify(res));
})(document);
(function() {
  "use strict"
  // Replace <script> tags in slides area to make them executable
  var scripts = document.querySelectorAll(
    '.remark-slides-area .remark-slide-container script'
  );
  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {
      s.setAttribute(scriptAttrs[j].name, scriptAttrs[j].value);
    }
    scripts[i].parentElement.replaceChild(s, scripts[i]);
  }
})();
(function() {
  var links = document.getElementsByTagName('a');
  for (var i = 0; i < links.length; i++) {
    if (/^(https?:)?\/\//.test(links[i].getAttribute('href'))) {
      links[i].target = '_blank';
    }
  }
})();</script>
<script>(function(data, token) {
  // data is an object of the form { path: base64 data }; we need to move base64
  // data back to HTML nodes (e.g., into the 'src' attribute of <img>, <audio>, <video>, <source>)
  var i, s, d, el, els;
  els = document.querySelectorAll(['img', 'audio', 'video', 'source'].map(x => x + '[src^="' + token + '"]').join(','));
  for (i = 0; i < els.length; i++) {
    el = els[i]; s = el.src.replace(token, ''); d = data[s];
    if (d) el.src = d;
  }
  els = document.querySelectorAll('div.remark-slide-content[style]');
  for (i = 0; i < els.length; i++) {
    el = els[i]; s = el.style.backgroundImage; if (!s) continue;
    s = s.match(/^url\("?(.+?)"?\)$/); if (!s || s.length < 2) continue;
    s = s[1].replace(token, ''); d = data[s];
    if (d) el.style.backgroundImage = 'url("' + d + '")';
